function I = fcnK3M(S, T, u, alpha, F, tol)
t1 = -alpha + u;t2 = 0.1e1 ./ t1;t3 = sqrt(-alpha);t4 = F - t3;t5 = t4 .^ 2;t6 = t4 .* t3;t9 = sqrt(t5 + 0.2e1 .* t6 - alpha + u);t10 = 0.1e1 ./ t9;t13 = t2 .* t3;t15 = 0.1e1 ./ u .* F;t16 = t10 .* t15;t19 = sqrt(t1);t21 = 0.1e1 ./ t19 ./ t1;t24 = 0.1e1 ./ t4;t26 = log(0.2e1 .* t24 .* (t9 .* t19 - alpha + t6 + u));t29 = F + t3;t30 = t29 .^ 2;t31 = t29 .* t3;t34 = sqrt(t30 - 0.2e1 .* t31 - alpha + u);t35 = 0.1e1 ./ t34;t38 = t35 .* t15;t42 = 0.1e1 ./ t29;t44 = log(0.2e1 .* t42 .* (t34 .* t19 - alpha - t31 + u));t50 = t1 .^ 2;t51 = 0.1e1 ./ t50;t52 = t51 .* alpha;t61 = 0.1e1 ./ t19 ./ t50 .* alpha;t64 = -alpha .* t3;t66 = 0.1e1 ./ alpha .* t64;t81 = t10 .* t2 ./ 0.2e1 - t16 .* t13 ./ 0.2e1 - t26 .* t21 ./ 0.2e1 + t35 .* t2 ./ 0.2e1 + t38 .* t13 - t44 .* t21 ./ 0.2e1 + t35 .* t42 .* t13 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t35 .* t52 + 0.3e1 ./ 0.4e1 .* t38 .* t51 .* alpha .* t3 - 0.3e1 ./ 0.4e1 .* t44 .* t61 + t10 .* t24 .* t2 .* t66 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t10 .* t52 + 0.3e1 ./ 0.4e1 .* t16 .* t51 .* t64 - 0.3e1 ./ 0.4e1 .* t26 .* t61 + t16 .* t2 .* t66 ./ 0.2e1;
I = t81(:,:,2) - t81(:,:,1);

end
